// Define the Subcomponent as a functional component
const Subcomponent = () => {
    return (
        // Return the JSX to render the content of the Subcomponent
        <h1 className="relative top-20 left-20 break-normal font-semibold text-5xl text-green-900">
            This is an example of subcomponent. Check the code.
        </h1>
    );
}

// Export the Subcomponent so it can be used in other parts of the app
export default Subcomponent;
